app.get('/recipes', async (req, res) => {
    try {
        const data = await Recipe.aggregate(
            [
                {
                    "$lookup": {
                        "let": { "authorObjectId": { "$toObjectId": "$authorId" } },
                        "from": "users",
                        "pipeline": [
                            { "$match": { "$expr": { "$eq": ["$_id", "$$authorObjectId"] } } },
                        ],
                        "as": "author"
                    }
                },
                { "$unwind": { path: "$author" } }
            ]).exec();
        res.send(data);
    } catch (e) {
        res.send(e);
    } finally {
        // await client.close();
    }
})

app.get('/recipe', async (req, res) => {
    let id = req.query.id;
    if (!id) {
        res.send("Missing attributes");
        return;
    }

    try {
        const data = await Recipe.aggregate(
            [
                { $match: { $expr: { $eq: ['$_id', { $toObjectId: id }] } } },
                {
                    "$lookup": {
                        "let": { "authorObjectId": { "$toObjectId": "$authorId" } },
                        "from": "users",
                        "pipeline": [
                            { "$match": { "$expr": { "$eq": ["$_id", "$$authorObjectId"] } } },
                        ],
                        "as": "author"
                    }
                },
                { "$unwind": { path: "$author" } }
            ]);
        console.log(data);
        res.send(data[0]);
    } catch (e) {
        res.send(e);
    } finally {
        // await client.close();
    }
})

